import { createSlice } from "@reduxjs/toolkit";
import { Product } from "../../types/Product";

interface ProductState {
  list: Product[];
}

const initialState: ProductState = {
  list: [
    { id: "bread", name: "The Health Factory Whole Wheat Bread", price: 50, image:"/images/bread.jpg", description: "Power of Wheat | High Pibre | No Preservatives | 200 gm" },
    { id: "milk", name: "Amul Gold Pasturised Full Cream Milk", price: 34, image:"images/milk.jpg", description: "500 ml" },
    { id: "cheese", name: "Cheese", price: 70, image:"images/chees.jpg", description: "f" },
    { id: "soup", name: "Soup", price: 125, image:"images/soup.jpg", description: "f" },
    { id: "butter", name: "Butter", price: 90, image:"images/butter.jpg", description: "f" },
  ]
};

const productsSlice = createSlice({
  name: "products",
  initialState,
  reducers: {}
});

export default productsSlice.reducer;
